-- OUTPUT: Data with the following fields
-- 	- PatientId (int)
--  - DateOfFirstDiagnosis (YYYY-MM-DD) 

-- Patient ID
-- Sex
-- Year of Birth
-- Ethnicity
-- Townsend Score
-- GP practice code
-- BMI values
-- Dates of positive COVID-19 test
-- Date of hospitalisations
-- Dates of COVID-19 vaccinations
-- Month of Death recorded (any causes)
-- Major comorbidities including type 1 diabetes, type 2 diabetes, asthma, COPD, angina, heart failure, MI, CABG, coronary angioplasty, stroke, any diagnosed malignancy, connective tissue disorders (especially rheumatoid arthritis, SLE, undifferentiated connective tissue disorders and ankylosing spondylitis), hypertension, depression, CKD, PTSD, Autism Spectrum Disorder, ADHD
-- Smoking/alcohol intake (units per week)


--Just want the output, not the messages
SET NOCOUNT ON;

--┌───────────────────────────────────────┐
--│ Define Cohort for RQ066: Long COVID   │
--└───────────────────────────────────────┘

-- OBJECTIVE: To build the cohort of patients needed for RQ066. This reduces
--						duplication of code in the template scripts. The cohort is any
--						patient with a suggestion of long covid. There is also a matched
--            cohort (3:1) on age, sex and date of covid test.
-- INPUT: No inputs
--
-- OUTPUT: Temp tables as follows:
-- #Patients - list of patient ids of the cohort

------------------------------------------------------------------------------

-- Table of all patients with a GP record
IF OBJECT_ID('tempdb..#Patients') IS NOT NULL DROP TABLE #Patients;
SELECT DISTINCT FK_Patient_Link_ID
INTO #Patients
FROM SharedCare.Patient
WHERE FK_Reference_Tenancy_ID=2
AND GPPracticeCode NOT LIKE 'ZZZ%';
-- 41s

--┌────────────────────────────────────────────────┐
--│ Patients with post-COVID syndrome (long COVID) │
--└────────────────────────────────────────────────┘

-- OBJECTIVE: To get tables of all patients with a post-COVID syndrome code in their record.
--            Separated into diagnosis, assessment and referral codes.
--
-- INPUT: Takes three parameters
--  - start-date: string - (YYYY-MM-DD) the date to count diagnoses from. Usually this should be 2020-01-01.
--	-	all-patients: boolean - (true/false) if true, then all patients are included, otherwise only those in the pre-existing #Patients table.
--	- gp-events-table: string - (table name) the name of the table containing the GP events. Usually is "SharedCare.GP_Events" but can be anything with the columns: FK_Patient_Link_ID, EventDate, and SuppliedCode
--
-- OUTPUT: One temp table as follows:
-- #PostCOVIDPatients
--	-	FK_Patient_Link_ID - unique patient id
--  - FirstPostCOVIDDiagnosisDate - First date of a post COVID diagnosis
--  - FirstPostCOVIDAssessmentDate - First date of a post COVID assessment
--  - FirstPostCOVIDReferralDate - First date of a post COVID referral

-- >>> Codesets required... Inserting the code set code
--
--┌────────────────────┐
--│ Clinical code sets │
--└────────────────────┘

-- OBJECTIVE: To populate temporary tables with the existing clinical code sets.
--            See the [SQL-generation-process.md](SQL-generation-process.md) for more details.

-- INPUT: No pre-requisites

-- OUTPUT: Five temp tables as follows:
--  #AllCodes (Concept, Version, Code)
--  #CodeSets (FK_Reference_Coding_ID, Concept)
--  #SnomedSets (FK_Reference_SnomedCT_ID, FK_SNOMED_ID)
--  #VersionedCodeSets (FK_Reference_Coding_ID, Concept, Version)
--  #VersionedSnomedSets (FK_Reference_SnomedCT_ID, Version, FK_SNOMED_ID)

--!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!
--!!! DO NOT EDIT THIS FILE MANUALLY !!!
--!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!

--#region Clinical code sets

IF OBJECT_ID('tempdb..#AllCodes') IS NOT NULL DROP TABLE #AllCodes;
CREATE TABLE #AllCodes (
  [Concept] [varchar](255) NOT NULL,
  [Version] INT NOT NULL,
  [Code] [varchar](20) COLLATE Latin1_General_CS_AS NOT NULL,
  [description] [varchar] (255) NULL 
);

IF OBJECT_ID('tempdb..#codesreadv2') IS NOT NULL DROP TABLE #codesreadv2;
CREATE TABLE #codesreadv2 (
  [concept] [varchar](255) NOT NULL,
  [version] INT NOT NULL,
	[code] [varchar](20) COLLATE Latin1_General_CS_AS NOT NULL,
	[term] [varchar](20) COLLATE Latin1_General_CS_AS NULL,
	[description] [varchar](255) NULL
) ON [PRIMARY];

